sourcesContent:
// Digital SAT Test Questions - December 2023
// Source: SAT_12_A.pdf (printed format)
// Complete question bank with all 4 modules

export const test2Questions = {
  readingWriting: [
    // ========================================
    // SECTION 1, MODULE 1: Reading and Writing (27 questions)
    // Answer Key: 1-5 BBABB, 6-10 BCBBB, 11-15 ADADC, 16-20 DADCD, 21-25 DAADB, 26-27 CB
    // ========================================

    // Question 1
    {
      id: 1,
      module: 1,
      domain: 'craft_structure',
      passage: `The National Heritage Fellowship was created to publicly ______ exceptional folk and traditional artists in the United States. In 1995, the fellowship was given to the Navajo (Diné) basket weaver Mary Holiday Black to celebrate her lifetime contributions to the arts.`,
      text: 'Which choice completes the text with the most logical and precise word or phrase?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'startle' },
        { letter: 'B', text: 'recognize' },
        { letter: 'C', text: 'familiarize' },
        { letter: 'D', text: 'convey' }
      ],
      correctAnswer: 'B'
    },

    // Question 2
    {
      id: 2,
      module: 1,
      domain: 'craft_structure',
      passage: `The following text is adapted from Kenneth Grahame's 1908 novel The Wind in the Willows. The Mole is dazed after briefly meeting a stranger while traveling with a friend.

[The] Mole stood still a moment, held in thought. As one wakened suddenly from a beautiful dream, who struggles to __recall__ it, and can re-capture nothing but a dim sense of the beauty of it, the beauty! Till that, too, fades away in its turn.`,
      text: 'As used in the text, what does the word "recall" most nearly mean?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'Begin' },
        { letter: 'B', text: 'Remember' },
        { letter: 'C', text: 'Overlook' },
        { letter: 'D', text: 'Reject' }
      ],
      correctAnswer: 'B'
    },

    // Question 3
    {
      id: 3,
      module: 1,
      domain: 'craft_structure',
      passage: `Text corpora such as the Bank of English are enormous collections of electronically stored texts that can be used for empirical testing of hypotheses regarding how ______ a word is in spoken and written English. For instance, one might have a guess about the incidence of the word "get," but only an analysis of a corpus can prove that "get" is the fifth most commonly used verb.`,
      text: 'Which choice completes the text with the most logical and precise word or phrase?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'pervasive' },
        { letter: 'B', text: 'profound' },
        { letter: 'C', text: 'credible' },
        { letter: 'D', text: 'assertive' }
      ],
      correctAnswer: 'A'
    },

    // Question 4
    {
      id: 4,
      module: 1,
      domain: 'craft_structure',
      passage: `British painter Peter Edwards is known for his portraits of notable figures in different fields, from poet Wendy Cope to mathematician Christopher Zeeman. Widespread admiration of these works has helped Edwards gain substantial ______ as an artist.`,
      text: 'Which choice completes the text with the most logical and precise word or phrase?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'sympathy' },
        { letter: 'B', text: 'prestige' },
        { letter: 'C', text: 'assistance' },
        { letter: 'D', text: 'tolerance' }
      ],
      correctAnswer: 'B'
    },

    // Question 5
    {
      id: 5,
      module: 1,
      domain: 'craft_structure',
      passage: `The Apalachicola River delta system is located in Florida, where the river drains into the Gulf of Mexico, and is shaped by ______ factors: for example, the geography of the coastline influences sedimentary deposition, which over time alters coastal geography.`,
      text: 'Which choice completes the text with the most logical and precise word or phrase?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'tenuous' },
        { letter: 'B', text: 'interdependent' },
        { letter: 'C', text: 'unyielding' },
        { letter: 'D', text: 'comprehensive' }
      ],
      correctAnswer: 'B'
    },

    // Question 6
    {
      id: 6,
      module: 1,
      domain: 'information_ideas',
      passage: `In the late 1800s, Spanish-language newspapers flourished in cities across Texas. San Antonio alone produced eleven newspapers in Spanish between 1890 and 1900. But El Paso surpassed all other cities in the state. This city produced twenty-two newspapers in Spanish during that period. El Paso is located on the border with Mexico and has always had a large population of Spanish speakers. Thus, it is unsurprising that this city became such a rich site for Spanish-language journalism.`,
      text: 'Which choice best states the main purpose of the text?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'To compare Spanish-language newspapers published in Texas today with ones published there during the late 1800s' },
        { letter: 'B', text: 'To explain that Spanish-language newspapers thrived in Texas and especially in El Paso during the late 1800s' },
        { letter: 'C', text: 'To argue that Spanish-language newspapers published in El Paso influenced the ones published in San Antonio during the late 1800s' },
        { letter: 'D', text: 'To explain why Spanish-language newspapers published in Texas were so popular in Mexico during the late 1800s' }
      ],
      correctAnswer: 'B'
    },

    // Question 7
    {
      id: 7,
      module: 1,
      domain: 'craft_structure',
      passage: `In Hoocąk, an Indigenous language from the Midwest region of what is now the United States, paras means "flat," whereas paraparač means "square." This phenomenon, in which an element of a root word is repeated, sometimes with modification, within another word that is related to the root word, is called reduplication. __In this case, the element "para" in paras gets repeated in paraparač.__ There are many examples of this type of reduplication in Hoocąk.`,
      text: 'Which choice best describes the function of the underlined sentence in the text as a whole?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'It emphasizes how frequently reduplication occurs in Hoocąk.' },
        { letter: 'B', text: 'It acknowledges that Hoocąk has some important exceptions to the general pattern described earlier.' },
        { letter: 'C', text: 'It elaborates on the discussion of reduplication by explaining how it works in the specific Hoocąk words introduced earlier.' },
        { letter: 'D', text: 'It provides English translations of the Hoocąk words mentioned earlier.' }
      ],
      correctAnswer: 'C'
    },

    // Question 8
    {
      id: 8,
      module: 1,
      domain: 'craft_structure',
      passage: `In a study by Mika R. Moran, Daniel A. Rodriguez, and colleagues, residents of Mexico City, Mexico, and Buenos Aires, Argentina, were surveyed about parks in their cities. Of the 562 respondents from Mexico City, 77.6% indicated that they use the city's parks, and of the 683 respondents from Buenos Aires, 69.9% indicated using city parks. Given that __the percentage of Mexico City respondents who reported living within a 10-minute walk of a park was much lower than that reported by Buenos Aires respondents__, greater proximity alone can't explain the difference in park use.`,
      text: 'Which choice best describes the function of the underlined portion in the text as a whole?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: "It marks a shift from a discussion of the researchers' conclusion to a discussion of their methods." },
        { letter: 'B', text: "It identifies the nature of a relationship that is significant to the text's conclusion." },
        { letter: 'C', text: "It provides context to help readers understand the scope of the researchers' survey." },
        { letter: 'D', text: 'It introduces a counterexample to the scenario described earlier in the text.' }
      ],
      correctAnswer: 'B'
    },

    // Question 9
    {
      id: 9,
      module: 1,
      domain: 'information_ideas',
      passage: `The following text is from Guy de Maupassant's 1884 short story "A Recollection," from the collection Guy de Maupassant Short Stories (translated by Albert M. C. McMaster et al. in 1903). The narrator is on a walk in the countryside outside of Paris, France.

I walked slowly beneath the young leaves, drinking in the air, fragrant with the odor of young buds and sap. I sauntered along, forgetful of musty papers, of the offices, of my chief, my colleagues, my documents, and thinking of the good things that were sure to come to me, of all the veiled unknown contained in the future. A thousand recollections of childhood came over me, awakened by these country odors, and I walked along, permeated with the fragrant, living enchantment, the emotional enchantment of the woods warmed by the sun of June.`,
      text: 'Which choice best states the main idea of the text?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'Having decided to leave his current employment, the narrator is returning to his childhood home in the country.' },
        { letter: 'B', text: "The narrator's natural surroundings help him escape his work concerns by prompting hopes about the future and memories of youth." },
        { letter: 'C', text: 'The narrator is using the quiet of the countryside to help him think about how projects at work could be advantageous for his career.' },
        { letter: 'D', text: 'The narrator forgets to address pressing work issues because the smells of the countryside distract him with thoughts of his youth.' }
      ],
      correctAnswer: 'B'
    },

    // Question 10
    {
      id: 10,
      module: 1,
      domain: 'information_ideas',
      passage: `Marrakech has high pedestrian traffic, but simply replicating a feature of Marrakech associated with walkability—e.g., its highly varied streetscape—may be insufficient to induce increased walking in other cities. As urbanist Mariela Alfonzo argues, our understanding of individuals' decision-making about whether to walk is insufficiently robust: some studies emphasize the role of demographic characteristics, others the role of public transit availability, and so on, but walking decisions are made in complex contexts in which multiple conditions and needs inform individuals' choices.`,
      text: 'Based on the text, Alfonzo would most likely agree with which statement about studies of decision-making about walking?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'They would be improved by efforts to identify the features that cities with high pedestrian traffic have in common.' },
        { letter: 'B', text: 'They are unlikely to find convincing evidence that any single factor consistently predicts walking decisions.' },
        { letter: 'C', text: 'They have overstated the extent to which people differ in their decision-making processes regarding walking.' },
        { letter: 'D', text: 'They tend to be misleading because they ignore the most important factor influencing walking decisions.' }
      ],
      correctAnswer: 'B'
    },

    // Question 11
    {
      id: 11,
      module: 1,
      domain: 'information_ideas',
      passage: `Total Areas of Five Tribal Nations around the United States

| Tribal nation | Location | Area (square miles) |
|---------------|----------|---------------------|
| Tohono O'odham Nation | Arizona | 4,453 |
| Crow Tribe | Montana | 3,606 |
| Leech Lake Band of Ojibwe | Minnesota | 1,311 |
| Yakama Nation | Washington | 2,188 |
| Muscogee Nation | Oklahoma | 4,867 |

In terms of total area, the Muscogee Nation is one of the largest tribal nations in the United States. It covers 4,867 square miles in what is now eastern Oklahoma. In comparison, the total area of the Leech Lake Band of Ojibwe in Minnesota is only ______`,
      text: 'Which choice most effectively uses data from the table to complete the comparison?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: '1,311 square miles.' },
        { letter: 'B', text: '2,188 square miles.' },
        { letter: 'C', text: '4,453 square miles.' },
        { letter: 'D', text: '3,606 square miles.' }
      ],
      correctAnswer: 'A'
    },

    // Question 12
    {
      id: 12,
      module: 1,
      domain: 'information_ideas',
      passage: `"Lines Written in Early Spring" is a 1798 poem by William Wordsworth. In the poem, the speaker describes having contradictory feelings while experiencing the sights and sounds of a spring day:`,
      text: 'Which quotation from "Lines Written in Early Spring" most effectively illustrates the claim?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: '"Through primrose-tufts, in that sweet bower, / The periwinkle trail\'d its wreathes; /And \'tis my faith that every flower / Enjoys the air it breathes."' },
        { letter: 'B', text: '"The budding twigs spread out their fan, / To catch the breezy air; /And I must think, do all I can, / That there was pleasure there."' },
        { letter: 'C', text: '"The birds around me hopp\'d and play\'d: / Their thoughts I cannot measure, / But the least motion which they made, / It seem\'d a thrill of pleasure."' },
        { letter: 'D', text: '"I heard a thousand blended notes, / While in a grove I [sat] reclined. / In that sweet mood when pleasant thoughts / Bring sad thoughts to the mind."' }
      ],
      correctAnswer: 'D'
    },

    // Question 13
    {
      id: 13,
      module: 1,
      domain: 'information_ideas',
      passage: `Dated Ages of Lunar Samples from Select Missions

| Mission | Year | Landing site | Approximate age (billions of years) |
|---------|------|--------------|-------------------------------------|
| Apollo 11 | 1969 | Mare Tranquilitatis | 3.6 |
| Apollo 15 | 1971 | Mare Imbrium | 3.3 |
| Apollo 17 | 1972 | Mare Serenitatis | 3.7 |
| Chang'e 5 | 2020 | Oceanus Procellarum | 2.0 |

The Apollo program missions were spaceflights to the moon led by the United States during the 1960s and 1970s during which astronauts collected some samples of the moon's surface. More recently, China launched the Chang'e 5 mission, which returned additional lunar surface samples. Researchers have analyzed and dated each of the samples, concluding that the lunar samples collected during the Chang'e 5 mission are significant because ______`,
      text: 'Which choice most effectively uses data from the table to complete the claim?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'they are much younger than the samples brought back from any of the Apollo missions.' },
        { letter: 'B', text: 'they were collected from the same landing site as the Apollo 11 mission.' },
        { letter: 'C', text: 'they are closest in age to the samples brought back by the Apollo 17 mission.' },
        { letter: 'D', text: 'they helped confirm the predicted ages of the lunar samples from the Apollo missions.' }
      ],
      correctAnswer: 'A'
    },

    // Question 14
    {
      id: 14,
      module: 1,
      domain: 'information_ideas',
      passage: `Biologist Rosanna Alegado believes that we might learn how multicellular organisms developed from single-celled ones if we understand why the single-celled organism Salpingoeca rosetta, the oldest living relative of animals, sometimes forms colonies of cells. Alegado and colleagues reviewed data from many studies of how S. rosetta responds when exposed to another type of single-celled organism, bacteria, including Eric W. Triplett's work with Dyadobacter fermentans bacteria and Jung-Hoon Yoon's work with Algoriphagus marincola bacteria. Alegado and colleagues concluded that both D. fermentans and A. marincola might have played a role in the development of multicellular organisms.`,
      text: "Which finding, if true, would most directly support Alegado and colleagues' conclusion?",
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'S. rosetta tended to form colonies when exposed to A. marincola but not when exposed to D. fermentans.' },
        { letter: 'B', text: 'Although several studies involving other bacteria species found that S. rosetta tended to form colonies after bacteria exposure, only the studies using D. fermentans and A. marincola tested whether the amount of bacteria exposure affected the rate of colony formation.' },
        { letter: 'C', text: 'S. rosetta tended to form colonies when exposed to D. fermentans but not when exposed to A. marincola.' },
        { letter: 'D', text: 'S. rosetta tended to form colonies when exposed to D. fermentans and when exposed to A. marincola.' }
      ],
      correctAnswer: 'D'
    },

    // Question 15
    {
      id: 15,
      module: 1,
      domain: 'information_ideas',
      passage: `The Millennium Cohort Study (MCS) examines trends in childhood development among 19,000 people in the United Kingdom unfolding over many years. As is true of most longitudinal studies, this need for years of data collection results in high costs. By contrast, a relatively straightforward fitness study, such as one that is merely trying to identify the percentage of regular exercisers in a city who do weight training, may not need a large budget because ______`,
      text: 'Which choice most logically completes the text?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: '19,000 people is more than enough for MCS to find trends in childhood development.' },
        { letter: 'B', text: 'longitudinal methods are probably suitable for the fitness study.' },
        { letter: 'C', text: 'the fitness study can be done well without years of data collection.' },
        { letter: 'D', text: 'it would be easy for MCS researchers to add questions to their childhood development study.' }
      ],
      correctAnswer: 'C'
    },

    // Question 16
    {
      id: 16,
      module: 1,
      domain: 'standard_conventions',
      passage: `Oyster mushrooms typically get their nutrients from the damp logs on which they grow, but the fungi are also carnivorous, with the ability to kill and consume microscopic worms known as nematodes. As researcher Yen-Ping Hsueh has shown, the mushrooms release a toxin that is deadly to nematodes that ______ in contact with it.`,
      text: 'Which choice completes the text so that it conforms to the conventions of Standard English?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'has come' },
        { letter: 'B', text: 'comes' },
        { letter: 'C', text: 'is coming' },
        { letter: 'D', text: 'come' }
      ],
      correctAnswer: 'D'
    },

    // Question 17
    {
      id: 17,
      module: 1,
      domain: 'standard_conventions',
      passage: `Cut, bent, and welded from discarded metal materials, the sculptures of London-based Nigerian artist Sokari Douglas Camp are meant to challenge viewers to consider their own relationships to material ______; her thought-provoking works in the 1999 exhibition Sokari Douglas Camp at the Smithsonian Institution's National Museum of African Art in Washington, DC, were no different.`,
      text: 'Which choice completes the text so that it conforms to the conventions of Standard English?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'wastes;' },
        { letter: 'B', text: 'wastes and to' },
        { letter: 'C', text: 'wastes,' },
        { letter: 'D', text: 'wastes' }
      ],
      correctAnswer: 'A'
    },

    // Question 18
    {
      id: 18,
      module: 1,
      domain: 'standard_conventions',
      passage: `The liquid compounds tetradecane (C₁₄H₃₀) and dodecane (C₁₂H₂₆) have molar masses of 198.39 and 170.33 ______ mass helps convert between the mass of the reactants and the mass of the product).`,
      text: 'Which choice completes the text so that it conforms to the conventions of Standard English?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'g/mol (respectively, in stoichiometry, molar' },
        { letter: 'B', text: 'g/mol, respectively, (in stoichiometry, molar' },
        { letter: 'C', text: 'g/mol. Respectively, in stoichiometry (molar' },
        { letter: 'D', text: 'g/mol, respectively (in stoichiometry, molar' }
      ],
      correctAnswer: 'D'
    },

    // Question 19
    {
      id: 19,
      module: 1,
      domain: 'standard_conventions',
      passage: `Scholars Tammy Kernodle and Paul Austerlitz have lent their expertise on Black history and music to an important new project: the Timeline of African American Music, a digital ______ through a rich combination of text, images, and music clips, traces the development of specific musical genres (such as funk and swing).`,
      text: 'Which choice completes the text so that it conforms to the conventions of Standard English?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'resource, that' },
        { letter: 'B', text: 'resource, that,' },
        { letter: 'C', text: 'resource that,' },
        { letter: 'D', text: 'resource that' }
      ],
      correctAnswer: 'C'
    },

    // Question 20
    {
      id: 20,
      module: 1,
      domain: 'standard_conventions',
      passage: `In Los Angeles County, California, bicycle paths such as the Expo Bikeway—which is about 15 miles long—have become an increasingly popular means of travel. Moreover, lawyer and cycling ______ has identified several features of the Los Angeles landscape, like its temperate climate and mostly flat roads, that make the city naturally bike-friendly.`,
      text: 'Which choice completes the text so that it conforms to the conventions of Standard English?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'advocate, Ernesto Hernandez-Lopez' },
        { letter: 'B', text: 'advocate, Ernesto Hernandez-Lopez,' },
        { letter: 'C', text: 'advocate Ernesto Hernandez-Lopez,' },
        { letter: 'D', text: 'advocate Ernesto Hernandez-Lopez' }
      ],
      correctAnswer: 'D'
    },

    // Question 21
    {
      id: 21,
      module: 1,
      domain: 'standard_conventions',
      passage: `While other even-toed ungulate species, such as the water buffalo (Bubalus bubalis), are among the most populous animal species on earth, the Przewalski's gazelle (Procapra przewalskii) has a total population between 700 and 800 ______ one of the criteria required for a species to be considered endangered.`,
      text: 'Which choice completes the text so that it conforms to the conventions of Standard English?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'individuals; fulfilling' },
        { letter: 'B', text: 'individuals: fulfilling' },
        { letter: 'C', text: 'individuals. Fulfilling' },
        { letter: 'D', text: 'individuals, fulfilling' }
      ],
      correctAnswer: 'D'
    },

    // Question 22
    {
      id: 22,
      module: 1,
      domain: 'expression_ideas',
      passage: `Ecologists like Renae Brodie use trophic pyramids to illustrate the food chain within a given ecosystem. At a typical pyramid's base are primary producers, like plants, followed by herbivores at the second trophic level, then omnivores and carnivores at the third. ______ at the fourth, highest trophic level are apex predators, like eagles, that feed on the animals below.`,
      text: 'Which choice completes the text with the most logical transition?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'Lastly,' },
        { letter: 'B', text: 'In fact,' },
        { letter: 'C', text: 'For example,' },
        { letter: 'D', text: 'Besides,' }
      ],
      correctAnswer: 'A'
    },

    // Question 23
    {
      id: 23,
      module: 1,
      domain: 'expression_ideas',
      passage: `In a 2022 analysis of 200 terms, researchers found a broad pattern of valence-dependent mutation in which negative adjectives saw a faster rate of cognate replacement—the rate at which a word will be replaced over time with a noncognate form—than other words. ______ the adjective "illegal" would be expected to mutate faster than the noun "crisis."`,
      text: 'Which choice completes the text with the most logical transition?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'As for this,' },
        { letter: 'B', text: 'Moreover,' },
        { letter: 'C', text: 'Meanwhile,' },
        { letter: 'D', text: 'However,' }
      ],
      correctAnswer: 'A'
    },

    // Question 24
    {
      id: 24,
      module: 1,
      domain: 'expression_ideas',
      passage: `In the early 1970s, Albert Popa took up graffiti art, spraying his work onto what was at the time an unconventional surface: concrete. ______ Albert's son David has chosen an unusual canvas for his new art project, Fractured. In this remarkable work, the artist draws charcoal faces onto fragmented ice floes in Finland, creating the visual effect of a face slowly fracturing.`,
      text: 'Which choice completes the text with the most logical transition?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'However,' },
        { letter: 'B', text: 'Indeed,' },
        { letter: 'C', text: 'Second,' },
        { letter: 'D', text: 'Likewise,' }
      ],
      correctAnswer: 'D'
    },

    // Question 25
    {
      id: 25,
      module: 1,
      domain: 'expression_ideas',
      passage: `While researching a topic, a student has taken the following notes:

• In 1965, Yale University historians claimed that a world map called the Vinland Map was drawn in the fifteenth century.
• Since that time, the map's age has been the subject of debate.
• In 2021, researchers conducted a study to analyze the elemental composition of the map's ink.
• Their analysis revealed that the ink contains a titanium compound not used in inks until the 1920s.
• The researchers concluded that the map was drawn in the twentieth century.`,
      text: 'The student wants to present the study and its findings. Which choice most effectively uses relevant information from the notes to accomplish this goal?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: "Given the debate about the Vinland Map's age, researchers in 2021 conducted a study to analyze the elemental composition of the map's ink." },
        { letter: 'B', text: "A 2021 study of the Vinland Map's ink revealed that it contains a titanium compound not used in inks until the 1920s, indicating that the map was drawn in the twentieth century." },
        { letter: 'C', text: 'The Vinland Map, believed by some to have been drawn in the fifteenth century, was the focus of a 2021 study.' },
        { letter: 'D', text: "Aware that a certain titanium compound was not used in inks until the 1920s, researchers in 2021 studied the elemental composition of the Vinland Map's ink." }
      ],
      correctAnswer: 'B'
    },

    // Question 26
    {
      id: 26,
      module: 1,
      domain: 'expression_ideas',
      passage: `While researching a topic, a student has taken the following notes:

• The El Pinito Mountains are a mountain range located in northwestern Mexico.
• The range is one of the dozens of "sky islands" in the southwestern US and northwestern Mexico.
• A sky island is an isolated mountain range whose environment differs drastically from that of the surrounding lowlands.
• The US Forest Service (USFS) said, "The mountains are 'islands' surrounded by deserts that are 'seas.'"
• The USFS said, "Each Sky Island is a unique ecosystem."`,
      text: 'The student wants to explain what a sky island is. Which choice most effectively uses relevant information from the notes to accomplish this goal?',
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'The USFS considers the El Pinito Mountains to be a "unique ecosystem."' },
        { letter: 'B', text: 'The El Pinito Mountains are an isolated mountain range located in northwestern Mexico whose environment differs drastically from that of the surrounding lowlands.' },
        { letter: 'C', text: 'A sky island is an isolated mountain range, such as the El Pinito Mountains in northwestern Mexico, whose environment differs drastically from that of the surrounding lowlands.' },
        { letter: 'D', text: 'The El Pinito Mountains, which are considered to be a sky island, are located in northwestern Mexico.' }
      ],
      correctAnswer: 'C'
    },

    // Question 27
    {
      id: 27,
      module: 1,
      domain: 'expression_ideas',
      passage: `While researching a topic, a student has taken the following notes:

• The International Center for the Arts of the Americas (ICAA) is directed by MariCarmen Ramírez.
• Ramírez oversaw an initiative to create an online archive of historical documents related to the history of Latin American and Latino visual art.
• The ICAA digitized over 10,000 documents, including the writings of Latin American and Latino artists and critics.
• The creation of the archive didn't require historical documents to be removed from their countries of origin.
• Scholars now have more access to these documents.`,
      text: "The student wants to explain an advantage of the ICAA's archive being digital. Which choice most effectively uses relevant information from the notes to accomplish this goal?",
      type: 'multipleChoice',
      options: [
        { letter: 'A', text: 'Over 10,000 documents related to the history of Latin American and Latino visual art are part of the ICAA archive.' },
        { letter: 'B', text: "By offering online versions of historical documents, the ICAA's archive provides more access to these materials without removing them from their countries of origin." },
